	Board(JSON input, JSON output)
	{
		_width = input[U"board"][U"width"].get<uint16>();
		_height = input[U"board"][U"height"].get<uint16>();
		n = input[U"general"][U"n"].get<int32>();
		for (int i = 0; i < _height; i++)
		{
			start.emplace_back(input[U"board"][U"start"][i].getString().narrow());
			goal.emplace_back(input[U"board"][U"goal"][i].getString().narrow());
		}
		board = start;
		for (int i = 0; i < n; i++)
		{
			heights.emplace_back(input[U"general"][U"patterns"][i][U"height"].get<int32>());
			widths.emplace_back(input[U"general"][U"patterns"][i][U"width"].get<int32>());
			patterns.push_back({});
			for (int j = 0; j < heights.back(); j++)
			{
				patterns.back().emplace_back(input[U"general"][U"patterns"][i][U"cells"][j].get<String>().narrow());
			}
		}
		n += 25;
		_ops_size = output[U"n"].get<int32>();
		for (int i = 0; i < _ops_size; i++)
		{
			m_p.emplace_back(output[U"ops"][i][U"p"].get<int32>());
			m_y.emplace_back(output[U"ops"][i][U"y"].get<int32>());
			m_x.emplace_back(output[U"ops"][i][U"x"].get<int32>());
			m_s.emplace_back(output[U"ops"][i][U"s"].get<int32>());
		}
	}

	void update_board()
	{
		int p = m_p[_steps];
		int y = m_y[_steps];
		int x = m_x[_steps];
		int s = m_s[_steps];
		_steps++;
		switch (s)
		{
		case 0:
			ofy = std::max(0, y);
			ofx = std::min(_width, x + widths[p]);
			for (m_j3 = std::max(0, x); m_j3 < ofx; ++m_j3) {
				a.clear();
				b.clear();
				for (m_i3 = ofy; m_i3 < _height; ++m_i3) {
					if (y + heights[p] <= m_i3 || patterns[p][m_i3 - y][m_j3 - x] == '0') {
						a.push_back(board[m_i3][m_j3]);
					}
					else {
						b.push_back(board[m_i3][m_j3]);
					}
				}
				a.append(b);
				for (m_i3 = ofy; m_i3 < _height; ++m_i3) {
					board[m_i3][m_j3] = a[m_i3 - ofy];
				}
			}
			break;
		case 1:
			ofy = std::min(_height, y + heights[p]);
			ofx = std::min(_width, x + widths[p]);
			for (m_j3 = std::max(0, x); m_j3 < ofx; ++m_j3) {
				a.clear();
				b.clear();
				for (m_i3 = 0; m_i3 < ofy; ++m_i3) {
					if (m_i3 < y || patterns[p][m_i3 - y][m_j3 - x] == '0') {
						a.push_back(board[m_i3][m_j3]);
					}
					else {
						b.push_back(board[m_i3][m_j3]);
					}
				}
				b.append(a);
				for (m_i3 = 0; m_i3 < ofy; ++m_i3) {
					board[m_i3][m_j3] = b[m_i3];
				}
			}
			break;
		case 2:
			ofy = std::min(_height, y + heights[p]);
			ofx = std::max(0, x);
			for (m_i3 = std::max(0, y); m_i3 < ofy; ++m_i3) {
				a.clear();
				b.clear();
				for (m_j3 = ofx; m_j3 < _width; ++m_j3) {
					if (x + widths[p] <= m_j3 || patterns[p][m_i3 - y][m_j3 - x] == '0') {
						a.push_back(board[m_i3][m_j3]);
					}
					else {
						b.push_back(board[m_i3][m_j3]);
					}
				}
				a.append(b);
				for (m_j3 = ofx; m_j3 < _width; ++m_j3) {
					board[m_i3][m_j3] = a[m_j3 - ofx];
				}
			}
			break;
		case 3:
			ofy = std::min(_height, y + heights[p]);
			ofx = std::min(_width, x + widths[p]);
			for (m_i3 = std::max(0, y); m_i3 < ofy; ++m_i3) {
				a.clear();
				b.clear();
				for (m_j3 = 0; m_j3 < ofx; ++m_j3) {
					if (m_j3 < x || patterns[p][m_i3 - y][m_j3 - x] == '0') {
						a.push_back(board[m_i3][m_j3]);
					}
					else {
						b.push_back(board[m_i3][m_j3]);
					}
				}
				b.append(a);
				for (m_j3 = 0; m_j3 < ofx; ++m_j3) {
					board[m_i3][m_j3] = b[m_j3];
				}
			}
			break;
		default:
			break;
		}
	}

